import React from "react";
import styles from "./App.module.scss";

function App() {
  let today = new Date();
  let time =
    today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();
  return (
    <div className={styles.screen}>
      <h2 className={styles.text}>{time}</h2>
    </div>
  );
}

export default App;
